import React from 'react'

// Sets data for the navbar
export const SidebarData = [
    // First navbar item
    {
        title: 'Program 1',
        path: '/',
        cName: 'nav-text'
    },
    // Second navbar item
    {
        title: 'Program 2',
        path: '/program',
        cName: 'nav-text'
    },
    // Third navbar item
    {
        title: 'Program 3',
        path: '/events',
        cName: 'nav-text'
    },
    // Fourth navbar item
    {
        title: 'Program 4',
        path: '/about',
        cName: 'nav-text'
    },
    // Fifth navbar item
    {
        title: 'Program 5',
        path: '/login',
        cName: 'nav-text'
    },
]
